import React from 'react'
import "./Navbar.scss";
import logo from "../../logo.png";


export default function Navbar() {
    return (
        <nav className="navbar">
            <img src={logo} alt="Logo Images"></img>

            <ul className="nav-link">
                <a></a>

            </ul>
        </nav>
    )
}
